import { Switch, Route } from 'react-router-dom';


import Home from '../Home/Home';
import Products from '../Products/Products';
import Phone from '../../components/Products/Phone';
import Tablet from '../../components/Products/Tablet';

            //<Route path="/products/phones" component={Phone} />
            //<Route path="/products/tablets" component={Tablet} />
export const Main = () => (
  <main>
    <Switch>
            <Route exact path='/' component={Home} />

            <Route path="/about" children={() => <h2>About</h2>} />
            

            <Route path='/products' component={Products} />
    </Switch>
  </main>
)
